import { Flex, Heading, VStack } from "@chakra-ui/layout";
import { useColorMode } from "@chakra-ui/color-mode";
import { FaSun, FaMoon } from "react-icons/fa";
import { Button, HStack, IconButton, Spacer } from "@chakra-ui/react";
import {
  Menu,
  MenuButton,
  MenuList,
  MenuGroup,
  MenuItem,
} from "@chakra-ui/menu";
const Navbar = () => {
  const { colorMode, toggleColorMode } = useColorMode();

  return (
    <VStack p={5}>
      <Flex w="100%">
        <Heading ml="8" size="md">
          FSND Casting Agency
        </Heading>
        <HStack spacing="20px" ml="10">
          <Menu>
            <MenuButton>Homepage</MenuButton>
          </Menu>
          <Menu>
            <MenuButton>Movies</MenuButton>
            <MenuList>
              <MenuGroup>
                <MenuItem>All Movies</MenuItem>
                <MenuItem>Add Movie</MenuItem>
              </MenuGroup>
            </MenuList>
          </Menu>
          <Menu>
            <MenuButton>Actors & Actresses</MenuButton>
            <MenuList>
              <MenuGroup>
                <MenuItem>All Actors & Actresses</MenuItem>
                <MenuItem>Add Actor or Actress</MenuItem>
              </MenuGroup>
            </MenuList>
          </Menu>
        </HStack>
        <Spacer />
        <Button colorScheme="teal">Log in</Button>
        <IconButton
          ml={8}
          icon={colorMode === "light" ? <FaMoon /> : <FaSun />}
          isRound="true"
          onClick={toggleColorMode}
        />
      </Flex>
    </VStack>
  );
};

export default Navbar;
